 @deansep317  mas cara, apesar de eu discordar que tenha 1 só mundial, ainda assim tem. Entende? Conquistar o mundo, jamais cair de divisão, é coisa de time grande, compreende? Não é uma circunstância que precisa de marca de leite ou de financeira pra acontecer, é grandeza. O Chelsea que o diga.

Se tirar a grana que pinga (não to falando da 51) todo mês aí, é... sei lá, um clube menor que seus 3 rivais. Cai pela terceira vez, pela quarta e tal. Não tem torcida pra segurar a bucha nas piores horas, é um clube bem sem sal. Fica mandando fax pras federações por pura inveja dos rivais... 

Nenhum descendente seu e nenhum ancestral seu viu ou verá o palmeiras ser declarado o melhor time da Terra. É uma sina, uma tortura, uma piada sem fim, um deleite dos rivais. E é uma piada que quanto mais o tempo passa, mais engraçada fica!

 @CorelliGassner  os próprios jogadores da época admitem que o nanico são Paulo caiu. Todo mundo sabe que virou a mesa e mudou o regulamento.

Todo mundo sabe mais ainda que seu time piada FALIU e mendigou prós maiores rivais.

Essa humilhação meu tem nunca passará, jamais passará

